import "./App.css";
import "./index.css";
import Moscu from "./Images/moscu.jpg";

function App() {
  return (
    <div className="App bg-black">
      <img className="w-7/12 ms-72 relative h-auto" src={Moscu} alt="moscu" />
      <button class="bg-blue-500 hover:bg-blue-700 me-30 float-center justify-items-start place-items-start relative  text-white font-bold py-2 px-4 rounded ">
        BOOK YOUR TABLE
      </button>
    </div>
  );
}

export default App;
